webpackJsonp([0xea1510c73ce0],{2460:function(n,e){n.exports={data:{markdownRemark:{html:'<p>Could it be the last White Brezza? It was the first PC / AT compatible machine for me, the first Pentium machine and it was the first Windows machine. (Rather than PC - 98 believer until now) Performance is nearly twelve times as much as the <a href="/pc-9821">previous generation</a> . I was expecting compatibility of software so far from the beginning, as expected. In this environment Windows Me is a little tight, as I got up to college and somewhat financial strength came out, I decided to make my own PC. After that, some parts were absorbed in the <a href="/Homebuilt-1">world\'s fastest No. 1 Ver.1</a> and discarded.</p>\n<h2>PC games that caught at the time</h2>\n<ul>\n<li>\n<p>BM 98</p>\n</li>\n<li>\n<p>Dazzle Dazzle Realization</p>\n</li>\n<li>\n<p>AMEL BROAT</p>\n</li>\n<li>\n<p>Andy\'s Adventure 2 · 3</p>\n<h2>Works / Other things I did</h2>\n</li>\n<li>\n<p>(Original game) <a href="/mk-iik">Mk - IIK</a></p>\n</li>\n<li>\n<p>(Original game) <a href="/choppin">Beef chop</a></p>\n</li>\n<li>\n<p>(Original game) <a href="/solo2k">PvDDR (6 Arrowne 2 K later)</a></p>\n<h2>Performance</h2>\n</li>\n<li>\n<p>CPU: intel Pentium (P 54 C / 100 MHz)</p>\n</li>\n<li>\n<p>RAM: 16 MB → 64 MB</p>\n</li>\n<li>\n<p>GPU: S3 Trio 64</p>\n</li>\n<li>\n<p>VRAM: 2 MB</p>\n</li>\n<li>\n<p>HDD: 4 GB (EIDE) + 2 GB (SCSI)</p>\n</li>\n<li>\n<p>Drive: 4 × CD-ROM drive × 1 + 3.5 inch FDD × 1</p>\n</li>\n<li>\n<p>NET: 10Base-T + 22.8kbps FaxModem</p>\n</li>\n<li>\n<p>SOUND: SB16 compatible</p>\n</li>\n<li>\n<p>OS: Windows 98 → Turbo Linux 3 → Windows 2000 Professional RC 1 → Windows Me</p>\n</li>\n</ul>',frontmatter:{cover:null,date:"1998-10-12T21:00:00+09:00",strDate:"1998/10/12",title:"(1998-2000) TOSHIBA BREZZA 5100CX"}}},pathContext:{path:"/en/blog/1998/10/12-brezza5100cx/",langKey:"en"}}}});
